-- Student
create table student (
	id INT NOT NULL AUTO_INCREMENT,
	first_name VARCHAR(50) not null,
	last_name VARCHAR(50),
	email VARCHAR(50),
	registration_date DATE not null,
	username VARCHAR(50) not null,
	password VARCHAR(50),
    location VARCHAR(50),
    unique (username),
    primary key (id)
);



-- Material
create table material (
	id INT NOT NULL AUTO_INCREMENT,
	name VARCHAR(50),
	type VARCHAR(20),
	link VARCHAR(2000),
	max_points INT,
    mandatory VARCHAR(5),
    primary key (id)
);



-- Career Path
CREATE TABLE career_path (
  id INT NOT NULL AUTO_INCREMENT,
  name VARCHAR(50) NOT NULL,
  description TEXT NOT NULL,
  PRIMARY KEY (`id`));
  


-- Course
create table course (
	id INT NOT NULL AUTO_INCREMENT,
	name VARCHAR(25) not null,
	description TEXT,
	course_fee VARCHAR(3) not null,
	language VARCHAR(8),
	release_date DATE not null,
	update_date DATE,
	instructor_id int,
    primary key (id),
    foreign key (instructor_id)
		references instructor(id)
        on delete restrict on update cascade
);


-- Chapter
create table chapter (
	id INT NOT NULL AUTO_INCREMENT,
	name VARCHAR(50) not null,
	section INT,
	order_in_section INT,
	description TEXT,
	course_id INT,
    Primary key (id),
    foreign key (course_id)
		references course(id)
		on delete cascade on update cascade
);



-- Related to
CREATE TABLE related_to(
career_path_id int,
course_id int,
primary key (career_path_id, course_id),
foreign key (career_path_id)
  references career_path(id)
    on delete cascade on update cascade,
foreign key (course_id)
  references course(id)
    on delete cascade on update cascade
);



-- Interested In
create table interested_in (
  student_id INT,
  career_path_id INT,
    primary key (student_id, career_path_id),
    foreign key (student_id)
    references student(id)
        on delete cascade on update cascade,
  foreign key (career_path_id)
    references career_path(id)
        on delete cascade on update cascade
);



-- Specialized In
create table specialized_in (
  instructor_id INT,
  career_path_id INT,
    primary key (instructor_id, career_path_id),
    foreign key (instructor_id)
    references instructor(id)
        on delete cascade on update cascade,
  foreign key (career_path_id)
    references career_path(id)
        on delete cascade on update cascade
);



-- Enrolled
create table enrolled (
	student_id INT,
	course_id INT,
	enrollment_date DATE not null,
	status VARCHAR(11) not null,
	feedback_rating INT,
	feedback_comment TEXT,
	PRIMARY KEY (student_id, course_id),
    foreign key (student_id)
		references student(id)
        on delete cascade on update cascade,
	foreign key (course_id)
		references course(id)
        on delete cascade on update cascade
);



-- Has Material
create table has_material (
	chapter_id INT,
	material_id INT,
	primary key (chapter_id, material_id),
    foreign key (chapter_id)
		references chapter(id)
        on delete cascade on update cascade,
	foreign key (material_id)
		references material(id)
        on delete cascade on update cascade
);



-- Assigned
CREATE TABLE assigned (
	student_id INT NOT NULL,
    material_id INT NOT NULL,
	status VARCHAR(12),
    start_time DATE,
    finish_time DATE,
    score FLOAT,
	PRIMARY KEY (student_id, material_id),
	FOREIGN KEY (student_id)
	REFERENCES student(id)
    ON DELETE CASCADE ON UPDATE CASCADE,
	FOREIGN KEY (material_id)
	REFERENCES material(id)
	ON DELETE CASCADE ON UPDATE CASCADE
);

