-- Assign multiple materials at once
SELECT student_id, material_id, 'assigned', null, null, null
FROM (
	SELECT student.id as 'student_id', material.id as 'material_id'
	FROM student, material 
	WHERE student.id IN 
			(	SELECT DISTINCT student.id
				FROM student
				INNER JOIN enrolled ON enrolled.student_id = student.id
				WHERE enrolled.course_id = 1 )
		AND material.id IN (19, 71, 403, 120, 187, 111, 493, 384, 80, 445)
	) as temp;

    
